import React ,{usestate} from 'react';
import ModalVote from './Modal/Modal';
function Vote(){
  
    
    return<>
    <div>
        <div id="vote">
            <button type="button"  onclick={()=>setopen(true)} id="logoVote"></button>
           <img src="../image/voting-box.png" alt=""    />
        </div>
        
         
        </div>
    </>;
}

export default Vote ;
